import axios from 'axios'

export const signup = newUser => {
    return  axios
        .post('users/signup', {
            name:newUser.name,
            password:newUser.password,
            email:newUser.email
        })
        .then(res => {
            console.log("Registered!")

        })
}

export const signin = user =>{
    return axios
    .post('users/signin', {
        email:user.email,
        password:user.password
    })
    .then(res =>{
        localStorage.setItem('usertoken',res.data)
        return res.data
    })
    .catch(err =>{
        console.log(err)

    })
}
